난 옛날부터 장 종류는 마트에서 안 사고(No맛, 화학물) 꼭 시골에서 국산 재료로 전통 방식으로 만드는 거 주문해서 먹는 사람인데 진배기꺼 다 역대급으로 괜찮아서 단골 할 거임. 가끔 된장이나 고추장 뭐 쓰는 지 물어보시는 분 많았는데 추천. 추석 선물로도 추천.
⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
쌈장 : 발효균이 살아있는 된장, 고추장, 청국장 등을 적절히 혼합하여 채소, 과채류, 고기와 궁합이 맞아 잘 어울림. 깔끔하고 풍부한 맛
⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
된장 : 철저한 품질관리로 생산된 국산 메주와 구운 소금, 청정 암반수를 사용하여 자체 개발한 발효 비법으로 12개월 숙성하여 깊고 풍부한 전통의 맛.
⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
고추장: 태양초 고추와 유기농 매실효소 과일즙을 사용하여 메줏가루를 최적의 비율로 혼합 생산. 빛깔이 곱고 찰기 있는 깊은 맛.
⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
간장 : 음식의 간을 소금보다 간장으로 하면 건강에 좋다. 저염이라 국, 무침, 찍음장에 좋다. 진하고 깔끔한 풍미.
⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
청국장 : 소화 흡수가 용이하도록 발효 시킨 숙성 기간이 짧은 이상적인 식품. 발효균과 섬유질이 장에 많은 도움.
