.. 키가 180까지 크고, 혹여 명문대를 나오더라도 지금처럼 우리의 소비가 유지되면 다 아무짝에도 쓸모가 없어진다.. 올 해 우리는 길고도 긴 전염병에 마스크없이는 외출도 하지 못하고, 가족도 친구도 마음대로 만나지 못하며, 대부분의 운동과 문화생활이 제한을 받고, 긴 장마에 농사도 어렵지 않는냐.. 아무리 골고루 먹어서 잘 자란다 한들( 이건 정말 아니라니깐요!!!) 멀지 않은 내일에 울 애들은 그간 노력한 것들을 펼치고 살 수 없다.. 그러니까 나는 지금 우리 애들을 위해 이리 애 쓰고 있는거다!! 라고 외쳤으나.. 너도 고기 좀 먹어라~~ 하고 끊으셨다 ㅠㅠ
