하긴.. 나 어릴 적 우리 집 식탁에 고기는 한 달에 한 두번, 한 근을 다섯식구가 다 못 먹고 남겼던... 그랬던 우리 엄마에게 골고루는 그 정도다.. 
그렇죠.. 모두가 그 정도였으면 우리는 지금 이런 어려움에 빠지지 않았겠죠...
..
이대로 지속된다면 앞으로 고기는 물론 채식도 어려워질텐데... 숨쉬기도 어려워질텐데.. 정말 무서운 건 그런건데... 공부 잘하고, 키 크고, 멋지고, 돈 많고... 다 필요없어질지도 모르는데...
부동산보다 더 급한건데..
다들 어디로 가고 있는건지...
..
